import React from 'react';

const QuestLog = () => {
  const projects = [
    {
      id: 1,
      name: 'AR Dinosaur',
      description: 'Used Unity and C# with Unity AR package.',
      achievement: 'AR Master',
      difficulty: 'expert',
      icon: 'üèÜ'
    },
    {
      id: 2,
      name: 'Blockie',
      description: '2D Game using Unity and C#. Adaptation of the famous game Tetris.',
      achievement: 'Block Puzzler',
      difficulty: 'advanced',
      icon: 'üß©'
    },
    {
      id: 3,
      name: 'Hungry Pac',
      description: 'Made with Unity and C#.',
      achievement: 'Arcade Legend',
      difficulty: 'intermediate',
      icon: 'üëæ'
    },
    {
      id: 4,
      name: 'AR Multiplayer',
      description: 'AR project integrated with Photon PUN 2, made in Unity and C#.',
      achievement: 'Network Ninja',
      difficulty: 'expert',
      icon: 'üåê'
    },
    {
      id: 5,
      name: 'BoatRush Madness',
      description: '2D project in Unity and C#.',
      achievement: 'Speed Demon',
      difficulty: 'advanced',
      icon: 'üö§'
    },
    {
      id: 6,
      name: 'AR Ball Game',
      description: 'Built in Unity and C#, using XR plugin.',
      achievement: 'Reality Bender',
      difficulty: 'expert',
      icon: '‚öΩ'
    },
    {
      id: 7,
      name: 'AR Earth and Heart',
      description: 'Tracks targets and shows 3D models and animation using Unity and XR plugin.',
      achievement: 'Model Master',
      difficulty: 'expert',
      icon: 'üåç'
    },
    {
      id: 8,
      name: 'VR Scene Changer',
      description: 'VR project built in Unity and C#.',
      achievement: 'Virtual Architect',
      difficulty: 'expert',
      icon: 'ü•Ω'
    }
  ];

  return (
    <section id="projects" className="game-section quest-log">
      <div className="container">
        <h2 className="section-title">Quest Log</h2>
        <div className="achievement-gallery">
          {projects.map((project) => (
            <div key={project.id} className="quest-card" data-difficulty={project.difficulty}>
              <div className="quest-badge">{project.icon}</div>
              <div className="quest-content">
                <h3>{project.name}</h3>
                <p>{project.description}</p>
                <div className="achievement">Achievement: {project.achievement}</div>
              </div>
              <div className={`difficulty-badge ${project.difficulty}`}>
                {project.difficulty.charAt(0).toUpperCase() + project.difficulty.slice(1)}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default QuestLog;
